        what : "Movie",
        Date : "April 24,2019"
    }
]
return (
    Marr.map((val,index)=>{
        return(
          <Navbar
            key = {index}
            images = {val.link}
            title = {val.title}
            date = {val.Date}
            btao = {val.what}
          />
        )
      })
)
};
export default Mcards;
